  "results": { "distinct": false, "ordered": true, "bindings": [
    { "x": { "type": "literal", "value": "character" }	, "characterTitle": { "type": "uri", "value": "http://dbpedia.org/resource/Goku" }	, "characterAuthor": { "type": "uri", "value": "http://dbpedia.org/resource/Akira_Toriyama" }	, "characterAbstract": { "type": "literal", "xml:lang": "en", "value": "Son Goku (Japanese: \u5B6B \u609F\u7A7A Hepburn: Son Gok\u016B) is a fictional character and the main protagonist of the Dragon Ball manga series created by Akira Toriyama. He is based on Sun Wukong, a main character in the classic Chinese novel Journey to the West. Goku is introduced in chapter #1 Bulma and Son Goku (\u30D6\u30EB\u30DE\u3068\u5B6B\u609F\u7A7A Buruma to Son Gok\u016B), originally published in Japan's Weekly Sh\u014Dnen Jump magazine on December 3, 1984, as an eccentric, monkey-tailed boy who practices martial arts and possesses superhuman strength. He meets Bulma and joins her on a journey to find the wish-granting Dragon Balls. Initially believed to be an Earthling, he is later revealed to be a member of an extraterrestrial warrior race called the Saiyans with the birth name Kakarrot (\u30AB\u30AB\u30ED\u30C3\u30C8 Kakarotto). As Goku matures, he becomes the universe's mightiest warrior and protects his adopted home planet, Earth, from villains who wish to harm it. Goku is depicted as carefree and cheerful when at ease, but quickly serious and strategic-minded when fighting. He is able to concentrate his ki and use it for devastatingly powerful energy-based attacks, the most prominent being his signature Kamehameha (\u304B\u3081\u306F\u3081\u6CE2, lit. \"Turtle Destruction Wave\") wave, in which Goku launches a blue energy blast from his palms. Also pure of heart, Goku cannot be harmed by evil waves like the Devil Beam, and he is one of the few who can ride the magic cloud called Kinto'un (\u7B4B\u6597\u96F2, lit. \"Somersault Cloud\", renamed \"Nimbus\" in Funimation's dub). As the protagonist, Goku appears in most of the episodes, films, television specials and OVAs of the manga's anime adaptations (Dragon Ball, Dragon Ball Z, Dragon Ball GT and Dragon Ball Super), as well as many of the franchise's video games. Due to the series' international popularity, Goku has become one of the most recognizable and iconic anime characters in the world. Outside the Dragon Ball franchise, Goku has made cameo appearances in Toriyama's self-parody series Neko Majin Z, has been the subject of other parodies, and has appeared in special events. Most Western audiences were introduced to the adult version of Goku appearing in the Dragon Ball Z anime, itself an adaptation of Dragon Ball manga volumes 17-42, as opposed to his initial child form, due to the limited success of the first series overseas. Goku's critical reception has been largely positive and he has been recognized as one of the greatest manga and anime characters of all time." }} ] } }
